import React from "react";
import './ImagemModal.css';
import { Children } from "react/cjs/react.production.min";

const ImagemModal = ( { children } ) => {

    return <div className="imagemmodal">
        <div className="imagemmodal-container">
            <div className="imagemmodal-blackop"></div>
            <button className="imagemmodal-butclose">Fechar</button>
            <div className="imagemmodal-content">{children}</div>
        </div>
    </div>;
};

export default ImagemModal;
